import{_ as t}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as l,c,a as e,b as d,e as r,w as a,f as o,r as p}from"./app.963e91c8.js";const h={},n=o('<p>\u901A\u8FC7\u5FEB\u6377\u952E\uFF0CVisual Studio Code \u53EF\u8BA9\u60A8\u76F4\u63A5\u4ECE\u952E\u76D8\u6267\u884C\u5927\u591A\u6570\u4EFB\u52A1\u3002</p><h2 id="\u5E38\u7528\u7684\u5FEB\u6377\u952E" tabindex="-1"><a class="header-anchor" href="#\u5E38\u7528\u7684\u5FEB\u6377\u952E" aria-hidden="true">#</a> \u5E38\u7528\u7684\u5FEB\u6377\u952E</h2><div class="custom-container tip"><p class="custom-container-title">\u30D2\u30F3\u30C8</p><p>\u4EE5\u4E0B\u8FD9\u4E9B\u5FEB\u6377\u952E\u5EFA\u8BAE\u5927\u5BB6\u719F\u7EC3\u638C\u63E1\uFF0C\u80FD\u591F\u5F88\u5927\u7A0B\u5EA6\u63D0\u9AD8\u5F00\u53D1\u6548\u7387\u3002</p></div><h3 id="\u9F20\u6807\u64CD\u4F5C" tabindex="-1"><a class="header-anchor" href="#\u9F20\u6807\u64CD\u4F5C" aria-hidden="true">#</a> \u9F20\u6807\u64CD\u4F5C</h3><ul><li><p>\u5728\u5F53\u524D\u884C\u7684\u4F4D\u7F6E\uFF0C\u9F20\u6807\u4E09\u51FB\uFF0C\u53EF\u4EE5\u9009\u4E2D\u5F53\u524D\u884C\u3002</p></li><li><p>\u7528\u9F20\u6807\u5355\u51FB\u6587\u4EF6\u7684\u884C\u53F7\uFF0C\u53EF\u4EE5\u9009\u4E2D\u5F53\u524D\u884C\u3002</p></li><li><p>\u5728\u67D0\u4E2A\u884C\u53F7\u7684\u4F4D\u7F6E\uFF0C\u4E0A\u4E0B\u79FB\u52A8\u9F20\u6807\uFF0C\u53EF\u4EE5\u9009\u4E2D\u591A\u884C\u3002</p></li></ul><h3 id="\u79FB\u52A8\u5149\u6807" tabindex="-1"><a class="header-anchor" href="#\u79FB\u52A8\u5149\u6807" aria-hidden="true">#</a> \u79FB\u52A8\u5149\u6807</h3><ul><li><p>\u300C\u65B9\u5411\u952E\u300D: \u5728<strong>\u5355\u4E2A\u5B57\u7B26</strong>\u4E4B\u95F4\u79FB\u52A8\u5149\u6807</p></li><li><p>\u300CCtrl + \u5DE6\u53F3\u65B9\u5411\u952E\u300D: \u5728<strong>\u5355\u8BCD</strong>\u4E4B\u95F4\u79FB\u52A8\u5149\u6807(\u5F88\u5E38\u7528)\u3002</p></li></ul><h3 id="\u5FEB\u901F\u9009\u4E2D" tabindex="-1"><a class="header-anchor" href="#\u5FEB\u901F\u9009\u4E2D" aria-hidden="true">#</a> \u5FEB\u901F\u9009\u4E2D</h3><p>\u5728\u4EFB\u610F\u4F4D\u7F6E\u5355\u51FB\u653E\u7F6E\u5149\u6807\uFF0C\u6309\u4F4F <code>shift</code> \u5728\u7B2C\u4E8C\u4E2A\u4F4D\u7F6E\u5355\u51FB\uFF0C\u5373\u53EF\u9009\u4E2D\u4E24\u5149\u6807\u4F4D\u7F6E\u95F4\u7684\u6240\u6709\u6587\u5B57\u3002</p><ul><li><p><code>Ctrl + Alt + \u2191/\u2193</code>: \u5411\u65B9\u5411\u952E\u65B9\u5411\u7684\u76F8\u90BB\u884C\u653E\u7F6E\u4E00\u4E2A\u5149\u6807\uFF1B</p></li><li><p><code>Alt + Click</code>: \u653E\u7F6E\u8F85\u52A9\u6E38\u6807\uFF1B</p></li><li><p><code>Shift + Alt + \u2190/\u2192</code>: \u6536\u7F29/\u6269\u5C55\u9009\u62E9\uFF1B</p></li><li><p><code>Shift + Alt</code> \u540C\u65F6\u62D6\u52A8\u5230\u5BF9\u89D2: \u5217(\u6846)\u9009\u62E9\uFF1B</p></li></ul><h3 id="\u5220\u9664" tabindex="-1"><a class="header-anchor" href="#\u5220\u9664" aria-hidden="true">#</a> \u5220\u9664</h3><ul><li><p><code>Ctrl + Backspace</code>: \u5220\u9664\u5149\u6807\u4E4B\u524D\u7684\u4E00\u4E2A\u5355\u8BCD</p></li><li><p><code>Ctrl + delete</code>: \u3000\u5220\u9664\u5149\u6807\u4E4B\u540E\u7684\u4E00\u4E2A\u5355\u8BCD</p></li><li><p><code>Ctrl + Shift + K</code>: \u5220\u9664\u6574\u884C</p></li></ul><h3 id="\u79FB\u52A8\u6587\u5B57" tabindex="-1"><a class="header-anchor" href="#\u79FB\u52A8\u6587\u5B57" aria-hidden="true">#</a> \u79FB\u52A8\u6587\u5B57</h3><ul><li><p><code>Alt + \u2191</code>: \u5149\u6807\u6240\u5728\u884C\u6216\u9009\u4E2D\u7684\u6587\u5B57\u7684\u6240\u6709\u884C\u6574\u4F53\u4E0A\u79FB\u4E00\u884C\uFF1B</p></li><li><p><code>Alt + \u2193</code>: \u5149\u6807\u6240\u5728\u884C\u6216\u9009\u4E2D\u6587\u5B57\u7684\u6240\u6709\u884C\u6574\u4F53\u4E0B\u79FB\u4E00\u884C</p></li></ul><h3 id="\u590D\u5236\u6587\u5B57" tabindex="-1"><a class="header-anchor" href="#\u590D\u5236\u6587\u5B57" aria-hidden="true">#</a> \u590D\u5236\u6587\u5B57</h3><ul><li><p><code>Alt + shift + \u2191</code>: \u5149\u6807\u6240\u5728\u884C\u6216\u9009\u4E2D\u7684\u6587\u5B57\u7684\u6240\u6709\u884C\u6574\u4F53\u5411\u4E0B\u590D\u5236\u4E00\u884C(\u5982\u679C\u9009\u4E2D\u4E86\u591A\u884C\u5C31\u662F\u590D\u5236\u591A\u884C)\uFF1B</p></li><li><p><code>Alt + shift + \u2193</code>: \u5149\u6807\u6240\u5728\u884C\u6216\u9009\u4E2D\u6587\u5B57\u7684\u6240\u6709\u884C\u6574\u4F53\u5411\u4E0A\u590D\u5236\u4E00\u884C(\u5982\u679C\u9009\u4E2D\u4E86\u591A\u884C\u5C31\u662F\u590D\u5236\u591A\u884C)\uFF1B</p></li><li><p><code>Ctrl + D</code>: \u9009\u62E9\u5149\u6807\u5904\u7684\u5355\u8BCD\uFF0C\u6216\u4E0B\u4E00\u6B21\u51FA\u73B0\u7684\u5F53\u524D\u9009\u62E9\uFF1B</p></li></ul><h3 id="\u4EE3\u7801\u64CD\u4F5C" tabindex="-1"><a class="header-anchor" href="#\u4EE3\u7801\u64CD\u4F5C" aria-hidden="true">#</a> \u4EE3\u7801\u64CD\u4F5C</h3><ul><li><p><code>Ctrl + /</code>: \u6DFB\u52A0\u5355\u884C\u6CE8\u91CA</p></li><li><p><code>Alt + shift + F</code>: \u4EE3\u7801\u683C\u5F0F\u5316</p></li><li><p><code>Ctrl + U</code>: \u5C06\u5149\u6807\u7684\u79FB\u52A8\u56DE\u9000\u5230\u4E0A\u4E00\u4E2A\u4F4D\u7F6E\u3001\u64A4\u9500\u5149\u6807\u7684\u79FB\u52A8\u548C\u9009\u62E9</p></li><li><p><code>Ctrl + Enter</code>: \u5728\u5F53\u524D\u884C\u4E0B\u9762\u65B0\u589E\u4E00\u884C\uFF0C\u7136\u540E\u8DF3\u81F3\u8BE5\u884C (\u5373\u4F7F\u5149\u6807\u4E0D\u5728\u884C\u5C3E\uFF0C\u4E5F\u80FD\u5FEB\u901F\u5411\u4E0B\u63D2\u5165\u4E00\u884C)</p></li><li><p><code>Ctrl + P</code>: \u5728\u5F53\u524D\u7684\u9879\u76EE\u5DE5\u7A0B\u91CC\uFF0C<strong>\u5168\u5C40</strong>\u641C\u7D22\u6587\u4EF6</p></li><li><p><code>Ctrl + G</code>: \u8DF3\u8F6C\u5230\u6307\u5B9A\u884C</p></li><li><p><code>Ctrl + shift + O</code>: \u5728\u5F53\u524D\u6587\u4EF6\u7684\u5404\u79CD<strong>\u65B9\u6CD5\u4E4B\u95F4</strong>\u8FDB\u884C\u8DF3\u8F6C</p></li></ul><h4 id="\u641C\u7D22" tabindex="-1"><a class="header-anchor" href="#\u641C\u7D22" aria-hidden="true">#</a> \u641C\u7D22</h4><ul><li><p><code>Ctrl + F</code>: \u67E5\u627E\uFF0C\u5149\u6807\u5728\u641C\u7D22\u6846\u91CC\uFF1B</p></li><li><p><code>F3</code>: \u5728\u5F53\u524D\u6587\u4EF6\u4E2D\u641C\u7D22\uFF0C\u5149\u6807\u4ECD\u5728\u7F16\u8F91\u5668\u91CC</p></li><li><p><code>Ctrl + Shift +F</code>: \u5168\u5C40\u641C\u7D22</p></li><li><p><code>Ctrl + H</code>: \u66FF\u6362\u3002</p></li></ul><h4 id="\u591A\u5149\u6807\u7684\u4F7F\u7528" tabindex="-1"><a class="header-anchor" href="#\u591A\u5149\u6807\u7684\u4F7F\u7528" aria-hidden="true">#</a> \u591A\u5149\u6807\u7684\u4F7F\u7528</h4><ol><li><p>\u6309\u4F4F Alt \u952E\uFF0C\u7136\u540E\u5728\u9875\u9762\u4E2D\u5E0C\u671B\u4E2D\u73B0\u5149\u6807\u7684\u4F4D\u7F6E\u70B9\u51FB\u9F20\u6807\u3002</p></li><li><p>\u9009\u4E2D\u67D0\u4E2A\u6587\u672C\uFF0C\u7136\u540E\u53CD\u590D\u6309\u4F4F\u5FEB\u6377\u952E <code>Ctrl + D</code> \u952E\uFF0C \u5373\u53EF\u5C06\u5168\u6587\u4E2D\u4E0E\u5149\u6807\u5F53\u524D\u6240\u5728\u4F4D\u7F6E\u7684\u8BCD\u76F8\u540C\u7684\u8BCD\u9010\u4E00\u52A0\u5165\u9009\u62E9\u3002</p></li><li><p>\u9009\u4E2D\u4E00\u5806\u6587\u672C\u540E\uFF0C\u6309\u4F4F <code>Alt + Shift + I</code> \u952E\uFF0C\u65E2\u53EF\u5728<strong>\u6BCF\u4E00\u884C\u7684\u672B\u5C3E</strong>\u90FD\u521B\u5EFA\u4E00\u4E2A\u5149\u6807\u3002</p></li></ol><h4 id="\u5DE5\u4F5C\u533A\u5FEB\u6377\u952E" tabindex="-1"><a class="header-anchor" href="#\u5DE5\u4F5C\u533A\u5FEB\u6377\u952E" aria-hidden="true">#</a> \u5DE5\u4F5C\u533A\u5FEB\u6377\u952E</h4><ul><li><p><code>Ctrl + B</code>: \u663E\u793A/\u9690\u85CF\u4FA7\u8FB9\u680F</p></li><li><p><code>Ctrl + \\</code>: \u521B\u5EFA\u591A\u4E2A\u7F16\u8F91\u5668</p></li><li><p><code>Ctrl + Pagedown/Pageup</code>: \u5728\u5DF2\u7ECF\u6253\u5F00\u7684\u6587\u4EF6\u4E4B\u95F4\u8FDB\u884C<strong>\u5207\u6362</strong></p></li><li><p><code>Ctrl + `</code>: \u6253\u5F00\u7EC8\u7AEF</p></li></ul><h3 id="\u4EE3\u7801\u6298\u53E0" tabindex="-1"><a class="header-anchor" href="#\u4EE3\u7801\u6298\u53E0" aria-hidden="true">#</a> \u4EE3\u7801\u6298\u53E0</h3><p><code>Ctrl + Shift + [</code>: \u6298\u53E0\u5149\u6807\u5904\u6700\u5185\u90E8\u7684\u672A\u6298\u53E0\u533A\u57DF\uFF1B</p><p><code>Ctrl + Shift +]</code>: \u5C55\u5F00\u5149\u6807\u5904\u7684\u6298\u53E0\u533A\u57DF\uFF1B</p><p><code>Ctrl + K Ctrl + [</code>: \u6298\u53E0\u5149\u6807\u5904\u6700\u5185\u90E8\u7684\u672A\u6298\u53E0\u533A\u57DF\u4EE5\u53CA\u8BE5\u533A\u57DF\u5185\u7684\u6240\u6709\u533A\u57DF\uFF1B</p><p><code>Ctrl + K Ctrl +]</code>: \u5C55\u5F00\u5149\u6807\u5904\u7684\u533A\u57DF\u4EE5\u53CA\u8BE5\u533A\u57DF\u5185\u7684\u6240\u6709\u533A\u57DF\uFF1B</p><p><code>Ctrl + K Ctrl + 0</code>: \u6298\u53E0\u7F16\u8F91\u5668\u4E2D\u7684\u6240\u6709\u533A\u57DF\uFF1B</p><p><code>Ctrl + K Ctrl + J</code>: \u5C55\u5F00\u7F16\u8F91\u5668\u4E2D\u7684\u6240\u6709\u533A\u57DF\uFF1B</p><p><code>Ctrl + K</code> <code>Ctrl</code> + <code>X</code>: \u6298\u53E0\u7EA7\u522B <code>X</code> \u7684\u6240\u6709\u533A\u57DF\uFF0C\u4F46\u5F53\u524D\u5149\u6807\u4F4D\u7F6E\u7684\u533A\u57DF\u9664\u5916\uFF1B</p><p><code>Ctrl + K Ctrl + /</code>: \u6298\u53E0\u4EE5\u5757\u6CE8\u91CA\u6807\u8BB0\u5F00\u5934\u7684\u6240\u6709\u533A\u57DF\uFF1B</p><div class="custom-container info"><p class="custom-container-title">\u5B98\u65B9\u6587\u6863</p><p><a href="/file/vscodeKeyboardShortcutsWindows.pdf">Windows \u4E0B VS Code \u5FEB\u6377\u952E\u6307\u5357</a> (\u82F1\u6587)</p></div><h3 id="windows-\u5FEB\u6377\u952E" tabindex="-1"><a class="header-anchor" href="#windows-\u5FEB\u6377\u952E" aria-hidden="true">#</a> Windows \u5FEB\u6377\u952E</h3><p><code>Ctrl + X</code>: \u526A\u5207\uFF1B</p><p><code>Ctrl + C</code>: \u590D\u5236\uFF1B</p><p><code>Ctrl + V</code>: \u7C98\u8D34\uFF1B</p><p><code>Ctrl + A</code>: \u5168\u9009\uFF1B</p><p><code>Ctrl + Z</code>: \u64A4\u9500\uFF1B</p><p><code>Ctrl + Y</code>: \u6062\u590D\uFF1B</p>',41),s={class:"custom-container info"},u=e("p",{class:"custom-container-title"},"\u95A2\u9023\u60C5\u5831",-1),C=o('<hr><p>\u4EE5\u4E0B\u662F\u4E00\u4E9B\u9AD8\u7EA7\u5185\u5BB9</p><h2 id="\u5FEB\u6377\u952E\u7F16\u8F91\u5668" tabindex="-1"><a class="header-anchor" href="#\u5FEB\u6377\u952E\u7F16\u8F91\u5668" aria-hidden="true">#</a> \u5FEB\u6377\u952E\u7F16\u8F91\u5668</h2><p>Visual Studio Code \u4F7F\u7528 <strong>\u952E\u76D8\u5FEB\u6377\u952E\u7F16\u8F91\u5668</strong> \u63D0\u4F9B\u4E86\u4E30\u5BCC\u800C\u4FBF\u6377\u7684\u952E\u76D8\u5FEB\u6377\u952E\u7F16\u8F91\u4F53\u9A8C\u3002\u5B83\u5217\u51FA\u4E86\u6240\u6709\u53EF\u7528\u547D\u4EE4(\u65E0\u8BBA\u662F\u5426\u5DF2\u6709\u5FEB\u6377\u952E\u7ED1\u5B9A)\uFF0C\u60A8\u53EF\u4EE5\u8F7B\u677E \u66F4\u6539 / \u5220\u9664 / \u91CD\u7F6E \u5176\u952E\u7ED1\u5B9A\u3002\u5B83\u8FD8\u5728\u9876\u90E8\u6709\u4E00\u4E2A\u641C\u7D22\u6846\uFF0C\u53EF\u5E2E\u52A9\u60A8\u67E5\u627E\u547D\u4EE4\u6216\u5FEB\u6377\u952E\u3002\u60A8\u53EF\u4EE5\u901A\u8FC7\u8F6C\u5230 <code>\u6587\u4EF6 &gt; \u9996\u9009\u9879 &gt; \u952E\u76D8\u5FEB\u6377\u65B9\u5F0F</code> \u4E0B\u7684\u83DC\u5355\u6765\u6253\u5F00\u6B64\u7F16\u8F91\u5668\u3002(macOS \u4E0A\u4E3A <code>\u4EE3\u7801 &gt; \u9996\u9009\u9879 &gt; \u952E\u76D8\u5FEB\u6377\u952E</code>)</p><h3 id="\u68C0\u6D4B\u952E\u7ED1\u5B9A\u51B2\u7A81" tabindex="-1"><a class="header-anchor" href="#\u68C0\u6D4B\u952E\u7ED1\u5B9A\u51B2\u7A81" aria-hidden="true">#</a> \u68C0\u6D4B\u952E\u7ED1\u5B9A\u51B2\u7A81</h3><p>\u5982\u679C\u60A8\u5B89\u88C5\u4E86\u8BB8\u591A\u6269\u5C55\u7A0B\u5E8F\u6216\u81EA\u5B9A\u4E49\u4E86\u952E\u76D8\u5FEB\u6377\u952E\uFF0C\u5219\u6709\u65F6\u4F1A\u5C06\u540C\u4E00\u952E\u76D8\u5FEB\u6377\u952E\u6620\u5C04\u5230\u591A\u4E2A\u547D\u4EE4\u65F6\u4F1A\u53D1\u751F\u952E\u7ED1\u5B9A\u51B2\u7A81\u3002\u8FD9\u53EF\u80FD\u5BFC\u81F4\u6DF7\u4E71\u7684\u884C\u4E3A\uFF0C\u5C24\u5176\u662F\u5F53\u60A8\u5728\u7F16\u8F91\u5668\u4E2D\u79FB\u52A8\u65F6\uFF0C\u4E0D\u540C\u7684\u952E\u7ED1\u5B9A\u8FDB\u5165\u548C\u8D85\u51FA\u8303\u56F4\u65F6\u3002</p><p>\u8BE5\u952E\u76D8\u5FEB\u6377\u952E\u7F16\u8F91\u5668\u6709\u4E00\u4E2A\u4E0A\u4E0B\u6587\u83DC\u5355\u547D\u4EE4\u663E\u793A\u76F8\u540C\u7684\u6309\u952E\u7EC4\u5408\uFF0C\u8FD9\u5C06\u7B5B\u9009\u57FA\u4E8E\u952E\u76D8\u5FEB\u6377\u952E\u6765\u663E\u793A\u51B2\u7A81\u7684\u952E\u7ED1\u5B9A\u3002</p><p>\u9009\u62E9\u4E00\u4E2A\u60A8\u8BA4\u4E3A\u88AB\u8986\u76D6\u6389\u7684\u952E\u7ED1\u5B9A\u547D\u4EE4\uFF0C\u60A8\u53EF\u4EE5\u67E5\u770B\u662F\u5426\u5B9A\u4E49\u4E86\u591A\u4E2A\u547D\u4EE4\uFF0C\u952E\u7ED1\u5B9A\u7684\u6765\u6E90\u4EE5\u53CA\u5B83\u4EEC\u4F55\u65F6\u5904\u4E8E\u6D3B\u52A8\u72B6\u6001\u3002</p><h3 id="\u67E5\u770B\u4FEE\u6539\u952E\u7ED1\u5B9A" tabindex="-1"><a class="header-anchor" href="#\u67E5\u770B\u4FEE\u6539\u952E\u7ED1\u5B9A" aria-hidden="true">#</a> \u67E5\u770B\u4FEE\u6539\u952E\u7ED1\u5B9A</h3><p>\u60A8\u53EF\u4EE5\u4F7F\u7528 <strong>\u66F4\u591A\u64CD\u4F5C(...)</strong> \u83DC\u5355\u4E2D\u7684 <strong>\u663E\u793A\u7528\u6237\u6309\u952E\u7ED1\u5B9A</strong>\u547D\u4EE4\u3002</p><h3 id="\u9AD8\u7EA7\u5B9A\u5236" tabindex="-1"><a class="header-anchor" href="#\u9AD8\u7EA7\u5B9A\u5236" aria-hidden="true">#</a> \u9AD8\u7EA7\u5B9A\u5236</h3><p>VS Code \u4E2D\u7684\u6240\u6709\u952E\u76D8\u5FEB\u6377\u952E\u90FD\u53EF\u4EE5\u901A\u8FC7\u8BE5 <code>keybindings.json</code> \u6587\u4EF6\u8FDB\u884C\u81EA\u5B9A\u4E49\u3002</p><ul><li>\u8981\u901A\u8FC7 JSON \u6587\u4EF6\u914D\u7F6E\u952E\u76D8\u5FEB\u6377\u952E\uFF0C\u8BF7\u6253\u5F00 <strong>\u952E\u76D8\u5FEB\u6377\u952E</strong> \u7F16\u8F91\u5668\uFF0C\u7136\u540E\u9009\u62E9\u7F16\u8F91\u5668\u6807\u9898\u680F\u53F3\u4FA7\u7684 **\u6253\u5F00\u952E\u76D8\u5FEB\u6377\u952E (JSON)**\u6309\u94AE\u3002</li><li>\u8FD9\u5C06\u6253\u5F00\u60A8\u7684 <code>keybindings.json</code> \u6587\u4EF6\uFF0C\u60A8\u53EF\u4EE5\u5728\u5176\u4E2D\u8986\u76D6\u9ED8\u8BA4\u7684\u6848\u4EF6\u7ED1\u5B9A\u3002</li></ul><p>\u60A8\u4E5F\u53EF\u4EE5\u4F7F\u7528\u4ECE\u547D\u4EE4\u9762\u677F(Ctrl + Shift + P)\u4E2D\u9009\u62E9 <strong>\u9996\u9009\u9879: \u6253\u5F00\u952E\u76D8\u5FEB\u6377\u65B9\u5F0F (JSON)</strong> \u547D\u4EE4\u6253\u5F00 <code>keybindings.json</code> \u6587\u4EF6\u3002</p>',14);functi